import React, { useState, useEffect } from 'react';
import Select from 'react-select';
import axios from 'axios';
import CityDetails from "./cityDetails";
import Titles from "./gameTitle";
import { Helmet } from "react-helmet";
import { SelectStyles, customFilterOption } from "./selectStyles";

export default function Game() {
    const [validGuesses, setValidGuesses] = useState([]);
    const [cities, setCities] = useState([]);
    const [guesses, setGuesses] = useState([]);
    const [currentGuess, setGuess] = useState(null);
    const [correctGuess, setCorrectGuess] = useState(false);
    const [title, setTitle] = useState("MESTODLE");

    useEffect(() => {
        FetchCities();
    }, []);

    const FetchCities = () => {
        axios.get("/mesta/all")
            .then(response => {
                if (response.data.status === "success") {
                    const data = response.data.cities;
                    data.sort((a, b) => a.value.localeCompare(b.value));
                    const transformedData = data.map(city => ({
                        value: city.nazev,
                        label: city.nazev
                    }));
                    setValidGuesses(transformedData);
                }
            })
            .catch(error => {
                console.error('Chyba při načítání měst:', error);
            });
    };

    const Guess = (e, type) => {
        e.preventDefault();
    
        if (!currentGuess) {
          return;
        }
    
        if (guesses.indexOf(currentGuess) !== -1) {
          return;
        }
    
        setValidGuesses(validGuesses.filter((item) => item.label !== currentGuess));
        setGuesses((guesses) => [...guesses, currentGuess]);
    
        axios.post("/mesta/guess",
            { guess: currentGuess }
          )
          .then(response => {
            if (response.data.status !== "success") {
              return;
            }
    
            const correct = response.data.correctGuess;
            const data = response.data.properties;
    
            setCities((cities) => [data, ...cities]);
    
            if (correct) {
              setCorrectGuess(true);
              setTitle(response.data.title);
            }
          })
          .catch((error) => {
            console.log(error);
            setCities([]);
          });
    };

    const Restart = () => {
        FetchCities();
        setGuesses([]);
        setCities([]);
        setGuess(null);
        setCorrectGuess(false);
    };

    return (
        <div className="container main pt-4 pb-5 mb-5">
            <Helmet>
                <title>{title}</title>
                <meta
                name="description"
                content=""
                />
            </Helmet>

            <h3 className="text-center pb-3">{title}</h3>

            <div className="d-flex justify-content-center mt-4 mb-3">
                <form
                className="form-control row g-3 mb-4"
                onSubmit={(e) => Guess(e, "guess")}
                id="guess-form"
                >
                <Select
                    className="select"
                    options={validGuesses}
                    onChange={(selectedOption) => setGuess(selectedOption.value)}
                    isDisabled={correctGuess}
                    styles={SelectStyles}
                    placeholder="Napiš jméno města"
                    filterOption={customFilterOption}
                    formatOptionLabel={(data) => (
                    <div className="select-option">
                        <span>{data.label}</span>
                    </div>
                    )}
                />

                <div className="d-flex justify-content-evenly">
                    {correctGuess ? (
                    <>
                        <button
                        className="btn btn-outline-dark mb-3 mt-1 min-vw-25"
                        onClick={Restart}
                        >
                        Next
                        </button>
                    </>
                    ) : (
                    <button className="btn btn-dark mb-3 mt-1 min-vw-25" type="submit">
                        Guess
                    </button>
                    )}
                    {!correctGuess && guesses.length >= 10 ? (
                    <button
                        className="btn btn-dark mb-3 mt-1 min-vw-25"
                        onClick={(e) => Guess(e, "city")}
                    >
                        Reroll
                    </button>
                    ) : (
                    ""
                    )}
                </div>
                </form>
            </div>

            {cities.length > 0 ? <Titles /> : ""}

            <div id="cities">
                {cities.map((town) => (
                <CityDetails
                    kraj={town.kraj_id}
                    populace={town.populace}
                    rozloha={town.rozloha}
                />
                ))}
            </div>
        </div>
    );
}
